(100, 'Da Soocha V', 8463.00, 'PLANET', 'STAR WARS GALAXY', 76, 'Moon in Hutt space housing a provisional Rebel base under siege from the Palpatine clone. Capital of the New Republic between the Dark Empire recapture of Coruscant and its destruction. It is destroyed by the Galaxy Gun.', 'resources/images/planets/dest_100tiny.jpg', 'resources/images/planets/dest_100sm.png', 'resources/images/planets/dest_100lg.png'),
