(131, 'Kashyyyk', 7042.00, 'PLANET', 'STAR WARS GALAXY', 80, 'Forest planet and home of the Wookiees. Also the site of one of the final battles of the Clone Wars.', 'resources/images/planets/dest_131tiny.jpg', 'resources/images/planets/dest_131sm.png', 'resources/images/planets/dest_131lg.png'),
