(133, 'Kessel', 9840.00, 'PLANET', 'STAR WARS GALAXY', 80, 'A mining planet that has been fought over by crime lords for its valuable Spice. A fissure vent beneath the spice mines served as a source of astatic coaxium, an element that could be refined into hyperfuel for starships.', 'resources/images/planets/dest_133tiny.jpg', 'resources/images/planets/dest_133sm.png', 'resources/images/planets/dest_133lg.png');
