(134, 'Khomm', 7941.00, 'PLANET', 'STAR WARS GALAXY', 70, 'Planet home to an insular society of clones.', 'resources/images/planets/dest_134tiny.jpg', 'resources/images/planets/dest_134sm.png', 'resources/images/planets/dest_134lg.png'),
(135, 'Kijimi', 4769.00, 'PLANET', 'STAR WARS GALAXY', 30, 'A frigid mountainous planet. It was the homeworld of Zorii Bliss, leader of the smuggling gang known as the Spice Runners of Kijimi. It is later destroyed by the Final Order as a show of force for the rest of the galaxy.', 'resources/images/planets/dest_135tiny.jpg', 'resources/images/planets/dest_135sm.png', 'resources/images/planets/dest_135lg.png'),
(136, 'Korriban', 4339.00, 'PLANET', 'STAR WARS GALAXY', 58, 'A planet used by generations of Sith lords. Known as Moraband in canon works.', 'resources/images/planets/dest_136tiny.jpg', 'resources/images/planets/dest_136sm.png', 'resources/images/planets/dest_136lg.png'),
