(150, 'Mon Cala', 5642.00, 'PLANET', 'STAR WARS GALAXY', 78, 'Ocean planet, home to the Mon Calamari and Quarren species. Also known as Mon Calamari, or Dac.', 'resources/images/planets/dest_150tiny.jpg', 'resources/images/planets/dest_150sm.png', 'resources/images/planets/dest_150lg.png'),
