(152, 'Mortis', 6560.00, 'PLANET', 'STAR WARS GALAXY', 53, 'Planet with a wall surrounding it, home to the three omnipotent Force wielders known only in the Jedi Archives as the Mortis Gods.', 'resources/images/planets/dest_152tiny.jpg', 'resources/images/planets/dest_152sm.png', 'resources/images/planets/dest_152lg.png'),
(153, 'Mustafar', 9343.00, 'PLANET', 'STAR WARS GALAXY', 58, 'An originally lush and forested planet that becomes volcanic and almost lifeless during an ancient battle. The hiding place of the Separatists leaders during the final hours of the Clone Wars, until they are killed by Darth Vader, who is later permanently scarred in a battle with Obi-Wan Kenobi. During the Imperial era, Vader builds his personal fortress on the planet. Vader\'s grandson, Kylo Ren, retrieves a Sith wayfinder from the ruins of his grandfather\'s fortress decades later.', 'resources/images/planets/dest_153tiny.jpg', 'resources/images/planets/dest_153sm.png', 'resources/images/planets/dest_153lg.png'),
(154, 'Muunilinst', 7351.00, 'PLANET', 'STAR WARS GALAXY', 36, 'Capital of the Intergalacting Banking Clan and homeworld of the Muun race, which includes Separatist leader San Hill and Sith Lord Darth Plagueis. The site of battles depicted in Star Wars: Clone Wars.', 'resources/images/planets/dest_154tiny.jpg', 'resources/images/planets/dest_154sm.png', 'resources/images/planets/dest_154lg.png'),
(155, 'Mygeeto', 4565.00, 'PLANET', 'STAR WARS GALAXY', 74, 'Cold, urban planet that served as a battle site in the final days of the Clone Wars, as well as the death place of Jedi Master Ki Adi Mundi.', 'resources/images/planets/dest_155tiny.jpg', 'resources/images/planets/dest_155sm.png', 'resources/images/planets/dest_155lg.png'),
(156, 'Myrkr', 4962.00, 'PLANET', 'STAR WARS GALAXY', 53, 'Treacherous swamp planet used by Talon Karrde and Mara Jade.', 'resources/images/planets/dest_156tiny.jpg', 'resources/images/planets/dest_156sm.png', 'resources/images/planets/dest_156lg.png'),
(157, 'Naboo', 8917.00, 'PLANET', 'STAR WARS GALAXY', 46, 'Home planet of the Gungans, including Jar-Jar Binks, and various humans, who compose a civilization called the Naboo, which includes Padmé Amidala and Emperor Palpatine.', 'resources/images/planets/dest_157tiny.jpg', 'resources/images/planets/dest_157sm.png', 'resources/images/planets/dest_157lg.png'),
