(163, 'Nur', 7796.00, 'PLANET', 'STAR WARS GALAXY', 49, 'Ocean moon with submerged volcanoes, and in its surface lies the Inquisitirium fortress.', 'resources/images/planets/dest_163tiny.jpg', 'resources/images/planets/dest_163sm.png', 'resources/images/planets/dest_163lg.png'),
