(165, 'Onderon', 5312.00, 'PLANET', 'STAR WARS GALAXY', 32, 'Jungle planet where Anakin Skywalker leads a revolt against its monarchy; birthplace of Saw Gerrera.', 'resources/images/planets/dest_165tiny.jpg', 'resources/images/planets/dest_165sm.png', 'resources/images/planets/dest_165lg.png'),
