(167, 'Pasaana', 7752.00, 'PLANET', 'STAR WARS GALAXY', 40, 'A desert planet on the edge of the galaxy, home to the Aki-Aki species.', 'resources/images/planets/dest_167tiny.jpg', 'resources/images/planets/dest_167sm.png', 'resources/images/planets/dest_167lg.png'),
(168, 'Pillio', 8434.00, 'PLANET', 'STAR WARS GALAXY', 90, 'Uncolonized aquatic planet with over 3 million species, and the location of one of Palpatine\'s observatories.', 'resources/images/planets/dest_168tiny.jpg', 'resources/images/planets/dest_168sm.png', 'resources/images/planets/dest_168lg.png'),
