(170, 'Ralltiir', 5301.00, 'PLANET', 'STAR WARS GALAXY', 81, 'Core world and galactic trading centre, occupied by Imperial forces under Lord Tion.', 'resources/images/planets/dest_170tiny.jpg', 'resources/images/planets/dest_170sm.png', 'resources/images/planets/dest_170lg.png'),
(171, 'Rattatak', 5806.00, 'PLANET', 'STAR WARS GALAXY', 54, 'Outer Rim planet and former home to Asajj Ventress. Homeworld of the white-skinned Rattataki. Ruled by various warlords.', 'resources/images/planets/dest_171tiny.jpg', 'resources/images/planets/dest_171sm.png', 'resources/images/planets/dest_171lg.png'),
(172, 'Rishi', 6840.00, 'PLANET', 'STAR WARS GALAXY', 71, 'Tropical planet used by the Republic to monitor the nearby cloning facility on Kamino.', 'resources/images/planets/dest_172tiny.jpg', 'resources/images/planets/dest_172sm.png', 'resources/images/planets/dest_172lg.png'),
(173, 'Rodia', 9982.00, 'PLANET', 'STAR WARS GALAXY', 89, 'Home planet of the Rodians, including Greedo. A remote swampy, jungle planet, it was represented by Onaconda Farr in the Galactic Senate during the Clone Wars.', 'resources/images/planets/dest_173tiny.jpg', 'resources/images/planets/dest_173sm.png', 'resources/images/planets/dest_173lg.png'),
(174, 'Rugosa', 4661.00, 'PLANET', 'STAR WARS GALAXY', 81, 'A moon that consists of giant coral reefs. Yoda meets King Katuunko of the Toydarians here.', 'resources/images/planets/dest_174tiny.jpg', 'resources/images/planets/dest_174sm.png', 'resources/images/planets/dest_174lg.png'),
(175, 'Ruusan', 4781.00, 'PLANET', 'STAR WARS GALAXY', 39, 'Barren planet housing the Valley of the Jedi. Site of a great battle between the Sith and the Jedi.', 'resources/images/planets/dest_175tiny.jpg', 'resources/images/planets/dest_175sm.png', 'resources/images/planets/dest_175lg.png'),
(176, 'Ryloth', 4899.00, 'PLANET', 'STAR WARS GALAXY', 42, 'Dry, hot home planet of the Twi\'leks, including Hera Syndulla and Jedi Master Aayla Secura.', 'resources/images/planets/dest_176tiny.jpg', 'resources/images/planets/dest_176sm.png', 'resources/images/planets/dest_176lg.png'),
(177, 'Sacorria', 9846.00, 'PLANET', 'STAR WARS GALAXY', 77, 'Planet near Corellia which attempts a coup against the New Republic.', 'resources/images/planets/dest_177tiny.jpg', 'resources/images/planets/dest_177sm.png', 'resources/images/planets/dest_177lg.png'),
(178, 'Saleucami', 5464.00, 'PLANET', 'STAR WARS GALAXY', 89, 'Primary terrain deserts and swamps. Home of the Clone Trooper deserter Cut Lawquane.', 'resources/images/planets/dest_178tiny.jpg', 'resources/images/planets/dest_178sm.png', 'resources/images/planets/dest_178lg.png'),
(179, 'Savareen', 9455.00, 'PLANET', 'STAR WARS GALAXY', 45, 'Desert and ocean planet. where destitute villages farm wind and refine coaxium. In Solo: A Star Wars Story, the Millennium Falcon arrives there after Han and his crew steal coaxium from Kessel, and Dryden Vos and Tobias Beckett die there.', 'resources/images/planets/dest_179tiny.jpg', 'resources/images/planets/dest_179sm.png', 'resources/images/planets/dest_179lg.png'),
(180, 'Scarif', 4519.00, 'PLANET', 'STAR WARS GALAXY', 73, 'Oceanic \"paradise world\" used for construction of the Death Star after Geonosis. When Rebel Alliance members raid the Imperial database from the secret base on one of its tropical islands, the secret base is destroyed to impede their escape with the Death Star plans.', 'resources/images/planets/dest_180tiny.jpg', 'resources/images/planets/dest_180sm.png', 'resources/images/planets/dest_180lg.png'),
