(183, 'Shili', 6524.00, 'PLANET', 'STAR WARS GALAXY', 62, 'Home planet of the Togruta, including Jedi Council member Shaak Ti and Ahsoka Tano.', 'resources/images/planets/dest_183tiny.jpg', 'resources/images/planets/dest_183sm.png', 'resources/images/planets/dest_183lg.png'),
