(185, 'Sorgan', 7376.00, 'PLANET', 'STAR WARS GALAXY', 72, 'A forested backwater planet in the Outer Rim mostly populated by human farmers who harvest krill which is used to make spotchka, a popular drink on the planet. Local farmers are constantly attacked by Klatooinians.', 'resources/images/planets/dest_185tiny.jpg', 'resources/images/planets/dest_185sm.png', 'resources/images/planets/dest_185lg.png'),
(186, 'Starkiller Base', 6071.00, 'BASE', 'STAR WARS GALAXY', 77, 'Snowy planet of forested mountains converted by the First Order into a superweapon. Later destroyed by the Resistance and gave birth to a miniature star, which was named \"Solo\" as an homage to Han Solo, who was killed by his son Kylo Ren on the planet. It is the converted version of Ilum.', 'resources/images/planets/dest_186tiny.jpg', 'resources/images/planets/dest_186sm.png', 'resources/images/planets/dest_186lg.png'),
(187, 'Subterrel', 7035.00, 'PLANET', 'STAR WARS GALAXY', 71, 'Mining planet mentioned by Dexter Jettster who spent time prospecting there. Located near Kamino, beyond the Outer Rim.', 'resources/images/planets/dest_187tiny.jpg', 'resources/images/planets/dest_187sm.png', 'resources/images/planets/dest_187lg.png'),
(188, 'Sullust', 6304.00, 'PLANET', 'STAR WARS GALAXY', 30, 'A volcanic planet whose atmosphere was highly toxic forcing the native Sullustans to build technologically advanced subterranean cities. It was the base of Imperial factories and the SoroSuub corporation employed roughly half the population.', 'resources/images/planets/dest_188tiny.jpg', 'resources/images/planets/dest_188sm.png', 'resources/images/planets/dest_188lg.png'),
(189, 'Takodana', 4231.00, 'PLANET', 'STAR WARS GALAXY', 68, 'Forest planet and site of Maz Kanata\'s castle. Neutral territory between First Order and Resistance.', 'resources/images/planets/dest_189tiny.jpg', 'resources/images/planets/dest_189sm.png', 'resources/images/planets/dest_189lg.png'),
(190, 'Tatooine', 4232.00, 'PLANET', 'STAR WARS GALAXY', 41, 'Desert planet and childhood home of Anakin Skywalker and Luke Skywalker. Location of Jabba the Hutt\'s palace.', 'resources/images/planets/dest_190tiny.jpg', 'resources/images/planets/dest_190sm.png', 'resources/images/planets/dest_190lg.png'),
(191, 'Teth', 7363.00, 'PLANET', 'STAR WARS GALAXY', 52, 'During the Clone Wars, Jabba\'s son Rotta is abducted by the Separatists and brought to this planet. Anakin and Ahsoka Tano travel to Teth and rescue Rotta from Asajj Ventress.', 'resources/images/planets/dest_191tiny.jpg', 'resources/images/planets/dest_191sm.png', 'resources/images/planets/dest_191lg.png'),
(192, 'Thyferra', 9452.00, 'PLANET', 'STAR WARS GALAXY', 40, 'Rainforest planet controlled by the Bacta Cartel.', 'resources/images/planets/dest_192tiny.jpg', 'resources/images/planets/dest_192sm.png', 'resources/images/planets/dest_192lg.png'),
(193, 'Toprawa', 6631.00, 'PLANET', 'STAR WARS GALAXY', 57, 'Imperial security facility and source of the first Death Star plans (supplanted by Scarif in Rogue One).', 'resources/images/planets/dest_193tiny.jpg', 'resources/images/planets/dest_193sm.png', 'resources/images/planets/dest_193lg.png'),
(194, 'Toydaria', 9330.00, 'PLANET', 'STAR WARS GALAXY', 88, 'Home planet of Watto and other Toydarians. Close to Nal Hutta.', 'resources/images/planets/dest_194tiny.jpg', 'resources/images/planets/dest_194sm.png', 'resources/images/planets/dest_194lg.png'),
(195, 'Trandosha', 5491.00, 'PLANET', 'STAR WARS GALAXY', 33, 'Homeworld of the Trandoshan hunters. Close to Kashyyyk.', 'resources/images/planets/dest_195tiny.jpg', 'resources/images/planets/dest_195sm.png', 'resources/images/planets/dest_195lg.png'),
(196, 'Umbara', 4386.00, 'PLANET', 'STAR WARS GALAXY', 60, 'Planet with a thick, foggy atmosphere. Home to the Umbarans.', 'resources/images/planets/dest_196tiny.jpg', 'resources/images/planets/dest_196sm.png', 'resources/images/planets/dest_196lg.png'),
(197, 'Utapau', 8217.00, 'PLANET', 'STAR WARS GALAXY', 32, 'Remote planet, covered in deep sinkholes and home to the Utai and Pau\'ans. Site of General Grievous\' defeat and a separatist base during the last days of the Clone Wars.', 'resources/images/planets/dest_197tiny.jpg', 'resources/images/planets/dest_197sm.png', 'resources/images/planets/dest_197lg.png'),
