(199, 'Vardos', 7397.00, 'PLANET', 'STAR WARS GALAXY', 64, 'Imperial stronghold and home to Iden and Garrick Versio. One of the first targets of Operation: Cinder.', 'resources/images/planets/dest_199tiny.jpg', 'resources/images/planets/dest_199sm.png', 'resources/images/planets/dest_199lg.png'),
