(2, 3, 57, '2019-01-01', 1, '2019-01-06', 1, 1, 'COMPLETED'),
(3, 46, 161, '2019-01-02', 1, '2019-01-09', 0, 1, 'COMPLETED'),
(4, 14, 120, '2019-01-02', 1, '2019-01-24', 0, 1, 'COMPLETED'),
(5, 10, 88, '2019-01-04', 1, '2019-01-29', 0, 1, 'COMPLETED'),
(6, 65, 52, '2019-01-04', 1, '2019-01-23', 1, 1, 'COMPLETED'),
(7, 32, 101, '2019-01-04', 1, '2019-01-31', 0, 1, 'COMPLETED'),
(8, 32, 10, '2019-01-04', 1, '2019-02-02', 1, 1, 'COMPLETED'),
(9, 63, 1, '2019-01-05', 1, '2019-01-28', 1, 1, 'COMPLETED'),
(10, 13, 149, '2019-01-05', 1, '2019-01-31', 0, 1, 'COMPLETED'),
(11, 13, 198, '2019-01-05', 1, '2019-01-09', 0, 1, 'COMPLETED'),
(12, 31, 55, '2019-01-06', 1, '2019-01-31', 0, 1, 'COMPLETED'),
(13, 26, 29, '2019-01-06', 1, '2019-02-05', 0, 1, 'COMPLETED'),
(14, 65, 5, '2019-01-06', 1, '2019-01-13', 1, 1, 'COMPLETED'),
(15, 17, 202, '2019-01-07', 1, '2019-01-24', 0, 1, 'COMPLETED'),
(16, 70, 98, '2019-01-09', 1, '2019-02-05', 0, 1, 'COMPLETED'),
(17, 9, 103, '2019-01-09', 1, '2019-01-26', 1, 1, 'COMPLETED'),
